import React from 'react'
import './CSS/Loginsignup.css'
import httpClient from '../httpClient'
import { useState,useEffect } from 'react'
import {User} from '../types'

export const Loginsignup = () => {
  const [email, setEmail] = useState('')
  const [password, setPassword] = useState('')


  const logInUser = async ()=>
  {
    console.log(email, password);
    try {
      const resp = await httpClient.post("//localhost:5000/login", {
        email,
        password
      });
      window.location.href = "/";
    } catch(error){
      if(error.response.status === 401){
        AnalyserNode("Invalid Email or Password")
      }
    }
  };



  const [user, setUser] = useState<User | null>(null)
  useEffect(() => {
  (async () => {
    try{
      const resp = await httpClient.get("//localhost:5000/@me")
      setUser(resp.data)
    } catch(error){
      console.log("Unauthorized");
    }


    })();
  }), [];





  return (
    <body>
    <div className='login'>
      <div class="login-box">
    <h2>Login</h2>
    <div class="textbox">
        <input type="text" placeholder="Email" value={email} name='email'onChange={(e)=>{setEmail(e.target.value)}} required/>
    </div>
    <div class="textbox">
        <input type="password" placeholder="Password" value={password} name='password'onChange={(e)=>{setPassword(e.target.value)}}required/>
    </div>
    <div class="remember-me">
        <input type="checkbox" id="remember" name="remember"/>
        <label for="remember">Remember Me</label>
    </div>
    <button type="button" class="btn" onClick={logInUser}>Sign Up</button>
        </div>

    </div>
    </body>
  )
}
export default Loginsignup
